ject \"${PROJECT_FILE_PATH}\" -configuration 'Release' -sdk 'iphonesimulator' clean build ARCHS='x86_64' VALID_ARCHS='x86_64' IPHONEOS_DEPLOYMENT_TARGET='7.0' TARGET_BUILD_DIR=\"${TEMP_DIR}/build-x86_64\" BUILT_PRODUCTS_DIR=\"${TEMP_DIR}/build-x86_64\"\n\n# SMASH 'EM ALL\nxcrun lipo -create \"${TEMP_DIR}/build-arm/${SF_EXECUTABLE_PATH}\" \"${TEMP_DIR}/build-arm64/${SF_EXECUTABLE_PATH}\" \"${TEMP_DIR}/build-i386/${SF_EXECUTABLE_PATH}\" \"${TEMP_DIR}/build-x86_64/${SF_EXECUTABLE_PATH}\" -output \"${BUILT_PRODUCTS_DIR}/${SF_WRAPPER_NAME}/Versions/A/${SF_TARGET_NAME}\"\n\nSF_PRODUCT_DIR=\"../../../product/ios\"\nSF_WRAPPER_PRODUCT_DIR=\"${SF_PRODUCT_DIR}/${SF_WRAPPER_NAME}\"\n\nif test ! -d \"${SF_PRODUCT_DIR}\"; then mkdir -p \"${SF_PRODUCT_DIR}\"; fi\n\nif test -d \"${SF_WRAPPER_PRODUCT_DIR}\";\nthen rm -rf \"${SF_WRAPPER_PRODUCT_DIR}\";\nfi\n\ncp -a \"${BUILT_PRODUCTS_DIR}/${SF_WRAPPER_NAME}\" \"${SF_PRODUCT_DIR}\"\n\n# Copy to current directory\n\n# Build the other platform.\n#xcrun xcodebuild -project \"${PROJECT_FILE_PATH}\" -target \"${TARGET_NAME}\" -configuration \"${CONFIGURATION}\" -sdk ${SF_OTHER_PLATFORM}${SF_SDK_VERSION} BUILD_DIR=\"${BUILD_DIR}\" OBJROOT=\"${OBJROOT}\" BUILD_ROOT=\"${BUILD_ROOT}\" SYMROOT=\"${SYMROOT}\" $ACTION\n\n# Smash the two static libraries into one fat binary and store it in the .framework\n#xcrun lipo -create \"${BUILT_PRODUCTS_DIR}/${SF_EXECUTABLE_PATH}\" \"${SF_OTHER_BUILT_PRODUCTS_DIR}/${SF_EXECUTABLE_PATH}\" -output \"${BUILT_PRODUCTS_DIR}/${SF_WRAPPER_NAME}/Versions/A/${SF_TARGET_NAME}\"\n\n# Copy the binary to the other architecture folder to have a complete framework in both.\n# cp -a \"${BUILT_PRODUCTS_DIR}/${SF_WRAPPER_NAME}/Versions/A/${SF_TARGET_NAME}\" \"${SF_OTHER_BUILT_PRODUCTS_DIR}/${SF_WRAPPER_NAME}/Versions/A/${SF_TARGET_NAME}\"\n";
